import { getCartItems } from "../redux/cartSlice";
import { useSelector } from "react-redux";

export const BackToCart = () => {
    const cartItems = useSelector(getCartItems);

    return(
        <button className="backToCartBtn cartParent">
            <img className="backToCartImg" src="./cart-loaded.png"></img>
            <span className="backToC">{cartItems.length > 0 ? cartItems.length : null}</span>
        </button>
    )
}
